import React,{useContext, useEffect, useState}from 'react';
import { Grid, TextField, makeStyles, InputLabel } from '@material-ui/core';
import { AppContext } from '../context';

const useStyles = makeStyles(theme => ({
    root: {
        
        padding: `0 ${theme.spacing(4)}px ${theme.spacing(4)}px ${theme.spacing(4)}px`,
    },
    label: {
        marginBottom: theme.spacing(1),
        color: 'black',
    },
    textField: {
        margin: "0 40px 0 0",
        width: "400px",
        
    },
    inputGroup: {
        marginTop: theme.spacing(2),
        
    }
}));

export default () => {
    const classes = useStyles();
    const [state, setState ] = useContext(AppContext);

    const [firstName,setFirstName] = useState('');
    const [lastName,setLastName] = useState('');

    useEffect(() => {        
        setState(state => ({ ...state, firstName:  firstName}));
        setState(state => ({...state, lastName: lastName}));
      }, [firstName, lastName],
        
      );

    return (
        <Grid container className={classes.root}>
            <Grid item md={6} className={classes.inputGroup}>
                <InputLabel  id="fullNameLabel"  className={classes.label}>Full Name</InputLabel>
                <TextField onChange={e => setFirstName(e.target.value)}  value={firstName} className={classes.textField}  />
            </Grid>
            <Grid item md={6} className={classes.inputGroup}>
                <InputLabel id="idNumberLabel" onChange={e => setState(state => {return {...state, i_id_num: e.target.value}})} className={classes.label}>SA ID Number</InputLabel>
                <TextField className={classes.textField} />
            </Grid>
            <Grid item md={6} className={classes.inputGroup}>
                <InputLabel id="telephoneLabel" onChange={e => setState(state => {return {...state, i_tel_num: e.target.value}})} className={classes.label}>Telephone Number</InputLabel>
                <TextField className={classes.textField} />
            </Grid>
            <Grid item md={6} className={classes.inputGroup}>
                <InputLabel id="cellphoneLabel" onChange={e => setState(state => {return {...state, i_cell_num: e.target.value}})}className={classes.label}>Cellphone Number</InputLabel>
                <TextField className={classes.textField} />
            </Grid>
            <Grid item md={12} className={classes.inputGroup}>
                <InputLabel id="addressLabel" onChange={e => setState(state => {return {...state, i_street_addr: e.target.value}})} className={classes.label}>Street Address</InputLabel>
                <TextField  multiline fullWidth />
            </Grid>
            <Grid item md={6} className={classes.inputGroup}>
                <InputLabel id="cityLabel" onChange={e => setState(state => {return {...state, i_city: e.target.value}})} className={classes.label}>City</InputLabel>
                <TextField className={classes.textField} />
            </Grid>
            <Grid item md={6} className={classes.inputGroup}>
                <InputLabel id="postalLabel" onChange={e => setState(state => {return {...state, i_post_code: e.target.value}})} className={classes.label}>Postal Code</InputLabel>
                <TextField className={classes.textField} />
            </Grid>
            <Grid item md={6} className={classes.inputGroup}>
                <InputLabel id="emailLabel" onChange={e => setState(state => {return {...state, i_femail: e.target.value}})} className={classes.label}>Email Address</InputLabel>
                <TextField className={classes.textField} />
            </Grid>
            <Grid item md={6} className={classes.inputGroup}>
                <InputLabel id="referredLabel" onChange={e => setState(state => {return {...state, i_refer_name: e.target.value}})} className={classes.label}>Referred By</InputLabel>
                <TextField className={classes.textField} />
            </Grid>
        </Grid>
    )
}
